    [TestFixture]
    public class PublishTests
    {
        [Test, RequiresSTA]
        public void publishWordDocument()
        {
            PublisherDialogHelper publisherDialogHelper = new PublisherDialogHelper();
            WorkingCopyPrototypeModel workingCopyPrototypeModel = publisherDialogHelper.initialiseWorkingCopy("msoWordDocument", "saveNewDocumentPrototype", new DummyCustomData());

            IPublishDocument publishDocumentParameters = new DummyPublishDocument();
            PublisherHelper publisherHelper = new PublisherHelper();
            bool success = publisherHelper.publishDocumentAs(workingCopyPrototypeModel, new DummyCustomData(), publishDocumentParameters);
            Assert.IsTrue(success);
        }
    }

